import { Component } from "react"
import "./LifeCycle.css"


export default class LifeCycle extends Component {

  constructor(props) {
    super(props)
    this.state = { favColor: "red", age: 26, name: "Akshay" }
  }

  render() {

    return (
      <div>
        <h1>My favColor is {this.state.age}</h1>
        <button onClick={() => { this.setState({ age: 20 }) }} >Click Me!</button>
      </div>
    )

  }



}
